import React, { Component } from "react";

class Sitzverteilung extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <h2 id="Sitzverteilung" style="margin-left: 2em;margin-top: 3em;">
          Sitzverteilung
        </h2>
        <div id="sitzverteilung_chart" style="width: 900px; height: 500px;">
          <img src="http://localhost:8000/query1_chart" />
        </div>
        <table
          id="sitzetabelle"
          style="table-layout: fixed;width: 30%; border-collapse: collapse; border: 1px solid rgb(17, 198, 44); text-align: center;"
        ></table>
      </React.Fragment>
    );
  }
}

export default Sitzverteilung;
